// Floating menu seen on home page
import './Menu.css'

const Menu = () => {
    return (
        <div className="menu">
            <div>
                <span className="menuText">Owen Boseley</span>
                <span className="typeBar menuText">_</span>
            </div>
        </div>
    );
}

export default Menu;
